webpackJsonp([54349966408626],{316:function(a,s){a.exports={data:{markdownRemark:{html:'<h1 id="custom-gatsby-page"><a href="#custom-gatsby-page" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Custom Gatsby page</h1>\n<p>Gatsby Docs Kit allows you to create your Gatsby page. To do so, follow these few steps:</p>\n<ol>\n<li>Go to <code class="language-text">www/src/pages</code></li>\n<li>Add <code class="language-text">my-page.js</code> with following content</li>\n</ol>\n<div class="gatsby-highlight" data-language="javascript">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">import</span> React <span class="token keyword">from</span> <span class="token string">\'react\'</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> <span class="token function-variable function">MyPage</span> <span class="token operator">=</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">(</span>\n  <span class="token operator">&lt;</span>div<span class="token operator">></span>\n    <span class="token operator">&lt;</span>h1<span class="token operator">></span><span class="token constant">HERE</span> <span class="token constant">SHOULD</span> <span class="token constant">BE</span> <span class="token constant">LANDING</span> <span class="token constant">PAGE</span><span class="token operator">&lt;</span><span class="token operator">/</span>h1<span class="token operator">></span>\n  <span class="token operator">&lt;</span><span class="token operator">/</span>div<span class="token operator">></span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token keyword">export</span> <span class="token keyword">default</span> MyPage<span class="token punctuation">;</span></code></pre>\n      </div>\n<blockquote>\n<p>Note that, because it is normal Gatsby page, you can also add here custom GraphQl query. See <a href="https://www.gatsbyjs.org/docs/querying-with-graphql/">Gatsby documentation</a> for more information.</p>\n</blockquote>\n<ol start="3">\n<li>Open <code class="language-text">www/gatsby-docs-kit.yml</code> and insert following snippet</li>\n</ol>\n<div class="gatsby-highlight" data-language="yaml">\n      <pre class="language-yaml"><code class="language-yaml"><span class="token punctuation">-</span> <span class="token key atrule">title</span><span class="token punctuation">:</span> MyPage\n  <span class="token key atrule">url</span><span class="token punctuation">:</span> /my<span class="token punctuation">-</span>custom<span class="token punctuation">-</span>url <span class="token comment"># note that it\'s not necessary to define url here</span>\n  <span class="token key atrule">file</span><span class="token punctuation">:</span> my<span class="token punctuation">-</span>page.js</code></pre>\n      </div>\n<ol start="4">\n<li>Open browser and visit <a href="http://localhost:8000/my-page">http://localhost:8000/my-page</a></li>\n</ol>\n<p>Not enough? <a href="https://www.gatsbyjs.org/">Read mode about GatsbyJS</a>.</p>'}},pathContext:{relativePath:"GDK>../docs/guides/custom-gatsby-page.md"}}}});
